/*Table structure for table `t_travel_note` */

DROP TABLE IF EXISTS `t_travel_note`;

CREATE TABLE `t_travel_note` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(256) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '标题',
  `cover_image` varchar(256) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '封面图',
  `description` varchar(512) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '描述',
  `location` varchar(128) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '位置',
  `view_count` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '浏览量',
  `up` int(11) DEFAULT NULL COMMENT '点赞数',
  `type` tinyint(1) DEFAULT NULL COMMENT '1-热门游记，0-最新发布',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`)
