/*Table structure for table `t_traveller` */

DROP TABLE IF EXISTS `t_traveller`;

CREATE TABLE `t_traveller` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '旅行家表id',
  `name` varchar(128) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '名字',
  `description` varchar(512) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '描述',
  `avatar` varchar(256) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '头像',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=357 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `t_traveller` */

insert  into `t_traveller`(`id`,`name`,`description`,`avatar`,`create_time`) values (30,'seamouse','已深度走访60国的新现实主义环球旅行者，战地（后）记者，近东和巴尔干音乐和文化采集者，国际电影节采访者及影评人，音乐节玩家，电影外景地收集人；在路上就是在上班，趁着旅行运和人品玩，抓紧深啃世界。','http://t1-q.mafengwo.net/s5/M00/B3/EB/wKgB3FGIlkOAMEn5AAFXnijDZeI17.jpeg','2021-12-29 16:22:35'),(68,'薛荣','宅男，前地理教师，作家，慢跑爱好者，景区梦游症患者，大龄书虫。TA的窝','https://dd-static.jd.com/ddimg/jfs/t1/139865/14/27167/538654/61e91ce6E1c27ca90/198c1ecc3cd0677a.png','2021-12-29 16:12:21'),(69,'王郢','10年行走藏区，曾在拉萨做过4年多小客栈，目前暂居大理；曾在报社和杂志任职编辑多年，因为想看更多的别人的生活而选择自由职业。TA的窝','http://t1-q.mafengwo.net/s5/M00/1D/78/wKgB3FILDIKAS5ytAAELzWAWShU18.jpeg','2021-12-29 16:21:33'),(89,'肖长春','自1983年利用寒暑假只身徒步近30年：走长城、走黄河、走独龙江、走怒江峡谷、走澜沧江峡谷、穿越雅鲁藏布大拐弯走墨脱（两次），间或漂流黄河，间或骑行黑龙江中俄边界、间或随马帮穿越玉曲大峡谷；也有冒死穿越川藏公路塌方区的经历，走帕隆藏布、走梅里雪山转经之路、走秦直道；目前大门不出二门不迈。TA的窝','http://t1-q.mafengwo.net/s7/M00/F4/8D/wKgB6lPGJTaAQgWuAACRDvzwjp050.jpeg','2021-12-29 16:31:36'),(96,'邵勉力','诗人、资深媒体人，中国作家协会会员。曾任《时尚财富》杂志总编辑兼出版人。2007年创办M画廊，落户北京798，迄今已代理超过50位当代艺术家的艺术作品。闲来爱旅游、爱玩耍、喜欢在沿途拍景色。','http://t1-q.mafengwo.net/s7/M00/14/5A/wKgB6lS_Y1KAQIOWAACrNLdcDSY07.jpeg','2021-12-29 16:33:00'),(99,'肖瑜','前媒体人，现公司人，专栏作者。别处生活的想象只是一种海市蜃楼，我只是想到处走走，看看这个世界。','http://t1-q.mafengwo.net/s6/M00/9B/49/wKgB4lKJg8iAWRKgAAFfQI-La7M25.jpeg','2021-12-29 15:25:38'),(101,'海尔森','业余游民，现居广州。飘忽不定，随性而活，但读书、行走、写字这三件事应该会一直坚持下去。经常被自己的好奇心折磨，尽量在生命租期截止前好好看看这个世界。','http://t1-q.mafengwo.net/s7/M00/23/4F/wKgB6lPzBOGADn8GAACZLJ_FzYI39.jpeg','2021-12-29 15:24:17'),(104,'余晨','在校研究生，蚂蜂窝蜂首作者，常驻广州。个子小，却想游遍整个大世界。会跟路上的汪喵打招呼，也会为了一朵小花停驻。世有喧嚣，心存诗情。我用自己的方式，去用心记录，用心体验，用心生活。这世界太美，岂可颓废？','http://t1-q.mafengwo.net/s6/M00/71/2C/wKgB4lKejUqAdhpFAADxG6Ig3Wo88.jpeg','2021-12-29 16:11:04'),(116,'喜喜','自由记者，神经大条、不可救药的乐观主义者，对任何事情都保持好奇，身体里永远充满冒险因子，那些看起来越神秘的国家越吸引我。我还喜欢和本地人交谈，用“沙发冲浪”的方式73次住进陌生人的家里，用独有的眼光去观察本地文化，写出和别人完全不同的旅行故事。微信公众号：喜喜见闻（Wanderlust_An）TA的窝','http://t1-q.mafengwo.net/s7/M00/4E/AB/wKgB6lOzvgaAXf6OAACLjfx1kNE37.jpeg','2021-12-29 16:24:09'),(140,'刘子超','旅行作家、资深媒体人、定制旅行策划师；1984年生于北京，2007年毕业于北京大学中文系；2012年中德媒体使者，2015-2016年牛津大学访问学者；先后任职于《南方人物周刊》、《GQ》中文版、《ACROSS穿越》；曾获2010年刘丽安诗歌奖、2014年“蚂蜂窝”年度旅行家；旅行文学作品《午夜降临前抵达》现已出版。','http://t1-q.mafengwo.net/s7/M00/4A/32/wKgB6lR2sUaAaCJoAADDC75gtgA57.jpeg','2021-12-29 15:20:23'),(143,'施坦丁','1976年生于新疆伊犁， 喜欢写作、旅行，2006年开始在中国云、贵、川、新疆、西藏地区及东南亚老挝、柬埔寨、越南、泰国等地收集少数民族传统音乐。TA的窝','http://t1-q.mafengwo.net/s7/M00/63/B5/wKgB6lSGZrOANUYbAAC3dGMwqNo31.jpeg','2021-12-29 16:25:39'),(144,'净源','不是旅行，只是一直在满世界换着地儿生活，亚非欧美都有过家；笃信该什么阶段做什么事情，十年从事项目融资得以周游天下，一朝隐退江湖养儿育女宜室宜家，现居美国西雅图，自由职业。TA的窝','http://t1-q.mafengwo.net/s7/M00/72/13/wKgB6lSGe7GAXlIMAADMc10BaaM68.jpeg','2021-12-29 16:13:56'),(154,'白宇','一个不浪会死的二货，一个热爱姑娘和远方的旅行者，一个拿不相信的事去说服自己的loser。Lofter ID：Rick\'s cafe   微信公众号：baiyu1984321   TA的窝','http://t1-q.mafengwo.net/s8/M00/A5/54/wKgBpVUd__SAEF3aAADy_BUll5Q34.jpeg','2021-12-29 16:39:39'),(165,'姜春苗','LonelyPlanet 广东作者，自由撰稿人和摄影师；爱好建筑、艺术、民俗与美食的慢旅行者；TA的微博','http://t1-q.mafengwo.net/s8/M00/C2/5B/wKgBpVV6fXiAH2w0AAF_7F-4Dts85.jpeg','2021-12-29 16:09:42'),(178,'狗子','本名贾新栩，生于北京，出版有长篇小说《一个啤酒主义者的独白》1、2，随笔集《一个寄生虫的愤怒》，《活去吧》，《散德行》。','http://t1-q.mafengwo.net/s8/M00/96/6C/wKgBpVXdjwOAc6LVAAEes-UnioU67.jpeg','2021-12-29 16:15:00'),(180,'孙助','山东人，暂住北京十余年，旅行作者；曾独自单车骑行中国海岸线8000公里、环骑塔克拉玛干沙漠3000公里、环骑台湾岛、海南岛、青海湖等；徒步穿越华北、华中的大部分山脉。《一路向南》编著者，在各类旅行类杂志发表游记数十篇。','http://t1-q.mafengwo.net/s8/M00/95/4E/wKgBpVXr2oSAF9hmAAC94jHBeMs13.jpeg','2021-12-29 16:19:03'),(187,'马大象','曾从事建筑设计，目前长期旅行，写身边发生的故事。\n微信公众号：badasstrip   微信：uglyelephant   微博：神经病马大象   TA的窝','http://t1-q.mafengwo.net/s9/M00/7F/B6/wKgBs1csElOASxv5AAF2F_ZLzo041.jpeg','2021-12-29 15:25:16'),(191,'邱晨晨','90后，不知道怎么定义作家与旅行家，但一直折腾着前进。从19岁开始实践旅行的梦想，已去过十几个国家，相信在一个国家找到一个房子住下来过一段柴米油盐的日子是最好的旅行方式。大学毕业开始间隔年，10个月去过6个国家，在约旦和毛里求斯工作生活。回国后在上海创业，从事VR相关内容。坚信经历越多越能讲好故事，看的风景越多越能明白人事。豆瓣专栏作家。TA的窝','http://t1-q.mafengwo.net/s9/M00/F7/53/wKgBs1hFQQuANy7nAAFgHeuJv6A60.jpeg','2021-12-29 16:24:36'),(209,'春树','作家、诗人，已出版《北京娃娃》《长达半天的欢乐》《光年之美国梦》等长篇小说，作品关注当下年轻人生活，喜欢摇滚乐，年轻一点的时候狂爱纽约，现在是巴黎脑残粉。亦出版个人诗集《激情万丈》及《春树的诗》，写诗是她的最爱。目前她和家人及一只叫Caesar的猫一起生活在北京及柏林。','http://t1-q.mafengwo.net/s12/M00/B6/F0/wKgED1v-omyATbLUAAFd-NKEJnw79.jpeg','2021-12-29 16:09:07'),(218,'Young','写文章，拍照片，做视频，游历世界，更在自己的第八大洲探险。博客：http://go2young.lofter.com。','http://t1-q.mafengwo.net/s2/M00/74/D2/wKgIDFt_dESAFblxAAC_l4Tre8w77.jpeg','2021-12-29 16:13:14'),(226,'喻添旧','1980年代生人。祖于关外，出于三晋，长于东海，擅远行。','http://t1-q.mafengwo.net/s10/M00/AC/DD/wKgBZ1pB6AWAIHx-AACxrRT0lUE53.jpeg','2021-12-29 16:11:59'),(234,'鸡狗乖图书馆','由两位馆员鸡＋犬组合而成，专职旅行。两人从自驾到骑行，从酒乡到遗迹，从大陆棚到基地营，从路边摊到星级美食……不设限旅途。鸡，韩裔美国人，挑夫、订票机器人、英文写作。犬，台湾人，中文写作。TA的窝','http://t1-q.mafengwo.net/s11/M00/3B/E6/wKgBEFpm2uKAMdk7AAGmS85GUP439.jpeg','2021-12-29 16:10:27'),(238,'穆丽德尔','穆丽德尔（哈萨克语：像幼驼眼睛一样清透），1991年出生，信仰爱、自由与朴素，崇尚自然、文学与公益，19岁开始远行，目前生活在新疆，融入当地原生态哈萨克族生活，以一个内地姑娘的眼光重新审视游牧文化，追求旅行中最极致的原生体验。','http://t1-q.mafengwo.net/s11/M00/96/80/wKgBEFpprkmAZz4KAAEITBNl9zo42.jpeg','2021-12-29 15:22:45'),(246,'何亦红','资深户外旅行者、媒体人，摄影师、旅行作者，马上走旅行文化工作室创始人。马背旅行、摩托车旅行爱好者、践行者、推广者。微信公众号：马上走（mashangz）；微博：@何土匪； ','http://t1-q.mafengwo.net/s11/M00/30/DA/wKgBEFql8iWACzbXAAFtaiButYM42.jpeg','2021-12-29 16:07:16'),(250,'沈寅','《Travel+Leisure》中文版新媒体总监，旅行vedio导演，前《外滩画报》主笔。曾经读万卷书，如今行万里路。','http://t1-q.mafengwo.net/s11/M00/5A/6E/wKgBEFqw2hSAYJcFAADzNXKMCWQ35.jpeg','2021-12-29 16:07:46'),(258,'佟琦','佟琦，生于北京，毕业于兰州大学。爱写作，爱顺其自然。十几年前以文学青年自居，现在依然以此自居。已发表《彼时春光》《游戏厅》《女朋友媛媛》《长河》等短篇小说，另著有长篇小说《就这么多》、电视剧本《出轨后遗症》等。','http://t1-q.mafengwo.net/s11/M00/B6/9E/wKgBEFqnZGSAPLInAADtOZfAWB465.jpeg','2021-12-29 15:22:14'),(262,'吉青子','自由撰稿人，WSET品酒师认证，铁道文化爱好者。致力于铁道文明的传达与保护，喜欢东风4、马莱4为首的内燃机与蒸汽机，老站房痴迷者。靠旅行、酒、火车、西域食物和游牧金属续命。微博：Hi栀紫；','http://t1-q.mafengwo.net/s11/M00/D6/81/wKgBEFqp4SyAR03SAAD7JCS-gv808.jpeg','2021-12-29 16:35:05'),(266,'斑马疆湖','斑马小姐与斑马先生，一行两人；独立撰稿、摄影纪实，专注南疆旅游文化。\n微信公众号：斑马疆湖；','http://t1-q.mafengwo.net/s11/M00/18/92/wKgBEFq5sj2AIslXAAHtQeN5Ar054.jpeg','2021-12-29 16:19:40'),(270,'西闪','独立作家、评论家，毕业于华西医科大学，著有《思想光谱》、《人的展开》、《书卷山城》、《普通读者》等书。文章常发表于《新京报》、《东方历史评论》、《南方都市报》、《南都周刊》等媒体，目前在《腾讯·大家》设有专栏。','http://t1-q.mafengwo.net/s11/M00/DF/75/wKgBEFq6JYyAVU3rAAFeX9co59012.jpeg','2021-12-29 15:21:21'),(274,'吴所不卉','海外汉教。做翻译，当记者，爱艺术，瞎捣鼓。户外运动狂热者，高加索进行时。微信公众号：lifeelsewhere；','http://t1-q.mafengwo.net/s11/M00/6C/4B/wKgBEFrMk8OAUxB4AADmDZTtMfk08.jpeg','2021-12-29 16:18:37'),(298,'Kiki','长途旅行者。我们到这个世界来，观察，学习，然后离开。学习所爱好的，瑜伽，按摩，画画，种植，花时间和自然在一起，在自然里野性生长。','http://t1-q.mafengwo.net/s11/M00/30/98/wKgBEFtEUe6Aa8VRAAH5-g5MHkI98.jpeg','2021-12-29 16:18:01'),(301,'曹企鹅','传媒业的小透明，生活中的旅行者，愿过上从书本中汲取、在旅途中经历、用文字去表达的日子。微信公众号：曹企鹅的小树洞   ','http://t1-q.mafengwo.net/s11/M00/B0/1C/wKgBEFts_IiAEf-zAAEYfcjeEJ864.jpeg','2021-12-29 16:08:38'),(305,'马鸽','出生于北京，本科毕业于意大利美术学院，旅居欧洲。发现单纯绘画救不了自己后，开始改行写作。','http://t1-q.mafengwo.net/s12/M00/D3/59/wKgED1usQ8CAYPfHAADfOIUp0kw50.jpeg','2021-12-29 16:34:27'),(321,'幸公拓','作家。旅行者。著有小说《子夜歌》《长眠不醒》等。2009年独自骑行新藏线，游记结集为《新藏行记》。','http://t1-q.mafengwo.net/s12/M00/B8/31/wKgED1vXBJ6AbnZQAAHKYsVheqo89.jpeg','2021-12-29 16:15:28'),(325,'leyton','喜欢用少量的旅行，配合奇怪的视角，以最实惠的方式制造胡思乱想。联合运营微信公众号：一人之家。小说《戏里佛》连载中。','http://t1-q.mafengwo.net/s12/M00/B6/3B/wKgED1vXA0-AGCBuAAHWqkDV5rg50.jpeg','2021-12-29 15:23:13'),(333,'续来来','文字工作者，资深媒体人。长期伏案，长期旅行，长期写作。\n','http://t1-q.mafengwo.net/s12/M00/68/35/wKgED1wHtyCABhcNAAFWjPrynM440.jpeg','2021-12-29 16:08:15'),(337,'沝令','前媒体人，旅居法国。闲时烹饪，写字。爱美食与旅行。不定期更新豆瓣专栏“巴黎谈吃”。','http://t1-q.mafengwo.net/s12/M00/51/96/wKgED1wIjHmAEUlMAAEpXJdbPDQ89.jpeg','2021-12-29 16:12:49'),(341,'Greg Miao','16岁当兵，83年留美，94年初成为华尔街顶级律所第一位华裔合伙人，纽约、香港、上海各住过10多年，喜爱旅行、野生动物、历史人文、地理、古典音乐芭蕾、摄影和写游记。17年初退休，去加拿大追寻少年时代的飞行梦。','http://t1-q.mafengwo.net/s12/M00/BA/B5/wKgED1wZqnSAKv_RAAGpdKSwb0U45.jpeg','2021-12-29 15:23:54'),(352,'然儿先生','95后，在法留学生，喜欢记录旅行中的小事；钟爱星空摄影，对群星璀璨的夜晚毫无抵抗力，梦想是去北欧看一次银河和极光；擅长在城市徒步，从南到北自西向东，总会有新的发现。','http://t1-q.mafengwo.net/s12/M00/16/E9/wKgED1wmKe-Aa1PSAAE-a0NJz5s33.jpeg','2021-12-29 15:24:42'),(356,'魏星','北京人，一九八一年生。二十岁左右曾留学日本。如今，偶著文章自娱。爱好小说、电影、运动、喝酒、旅行。近几年始，多次往返日本旅行，住一段日子，过一过生活，多为交通不甚发达地区。','http://t1-q.mafengwo.net/s13/M00/C8/5D/wKgEaVxuZ4SAH4oOAAG2JeacU6862.jpeg','2021-12-29 16:20:35');

/*Table structure for table `t_traveller_note` */

DROP TABLE IF EXISTS `t_traveller_note`;

CREATE TABLE `t_traveller_note` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '旅行家专栏',
  `title` varchar(128) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '标题',
  `thumbnail` varchar(128) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '缩略图',
  `description` varchar(512) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '描述信息',
  `view` int(11) DEFAULT NULL COMMENT '阅读数',
  `writer_id` int(11) DEFAULT NULL COMMENT '作者id（即旅行家id）',
  `detail_content` varchar(128) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '游记详细（游记html存储地址）',
  `publish_time` date DEFAULT NULL COMMENT '发布时间',
  PRIMARY KEY (`id`),
  KEY `writer_id` (`writer_id`),
  CONSTRAINT `t_traveller_note_ibfk_1` FOREIGN KEY (`writer_id`) REFERENCES `t_traveller` (`id`)
