/*Table structure for table `t_travelnote_detail` */

DROP TABLE IF EXISTS `t_travelnote_detail`;

CREATE TABLE `t_travelnote_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `tn_id` int(11) NOT NULL COMMENT 'travel_note_id',
  `publiser_avatar` varchar(256) DEFAULT NULL COMMENT '游记发布者头像',
  `publiser_name` varchar(128) DEFAULT NULL COMMENT '游记发布者名字',
  `publish_time` varchar(128) DEFAULT NULL COMMENT '游记发布时间',
  `start_time` varchar(128) DEFAULT NULL COMMENT '出发时间',
  `day` varchar(128) DEFAULT NULL COMMENT '天数',
  `cost` varchar(128) DEFAULT NULL COMMENT '费用',
  `content` varchar(128) DEFAULT NULL COMMENT '文章详情（html标签）',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `tn_id` (`tn_id`),
  CONSTRAINT `t_travelnote_detail_ibfk_1` FOREIGN KEY (`tn_id`) REFERENCES `t_travel_note` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8mb4;

